import HeaderCard from "./HeaderCard";

import "./Header.css";

const Header = (props) => {
  const funds = props.money;

  const plan = "3";

  return (
    <div className="top container row">
      <HeaderCard>
        <h3>
          Money: <span>Kr. {funds},-</span>
        </h3>
      </HeaderCard>
      <HeaderCard>
        <h3>
          Next Plan: <span>{plan} days left</span>
        </h3>
      </HeaderCard>
    </div>
  );
};

export default Header;
